import ReactDOM from "react-dom";
import "bootstrap/dist/css/bootstrap.css";

import "./global.css";
import Badge from "./components/Badge";

// // ReactDOM.render(__qué__, __dónde__);
ReactDOM.render(
	<Badge
		firstName="Lilly"
		lastName="Heredia"
		jobTitle="Frontend Engineer"
		twitter="twister"
	/>,
	document.getElementById("app")
);
